import styled from 'styled-components'

export const StyledStartButton = styled.button`
box-sizing: border-box;
margin: 0 0 20px 0;
width: 100%;
border-radius: 20px;
border: none;
color: white;
background: green;
font-family: Pixel, Arial, Helvetica, sand-serif;
font-size: 1px;
outline: none;
cursor: pointer;
`
